import React from "react";
import CommonTable from "../components/common/CommonTable";

const HeaderValue = [
  "Service Name",
  "Category",
  "Vehicle CC",
  "Description",
  "Price"
];

const Service = () => {
  const [data, setData] = React.useState([]);

  React.useEffect(() => {
    getData();
  }, []);

  return (
    <CommonTable data={data} Header={HeaderValue} buttonLabel={"Add Service"} />
  );
};

export default Service;
